window.bookSummaryJSON = "<p><b>Warning</b>: This audiobook is not for the faint of heart, fawningly polite, or desperate to be liked. This audiobook is expressively for entrepreneurs and business owners who wear many hats - those who can't resist piling more responsibility onto his own shoulders, who has more great ideas than time and resources to take advantage of them, who runs (not walks) through each day. Your time is incredibly valuable to you, and you are constantly \"running out of it\".</p> <p>Serial entrepreneur Dan S. Kennedy delivers a fresh take on the mantra \"time is money\" as he shows you how to drastically re-engineer your entire relationship with time and, if applied faithfully, achieve peak personal productivity and make lots and lots of money.</p> <p>Learn how to:</p> <p></p> <ul> <li><b>Accurately calculate the value of your time</b> - and put a meter on those consuming it</li> <li><b>Slay time vampires</b> - like Mr. Have-You-Got-a-Minute, Mr. Meeting, and all the other bloodsuckers</li> <li><b>Stop \"productivus interruptus</b>\" - master the five time-defense tactics</li> <li><b>Achieve maximum productivity</b> with psycho-cybernetics</li> <li><b>The eight No B.S. Time Truths</b> never to violate despite the conspiracy against them</li> <li>Become successful beyond your wildest dreams - <b>apply the number one most powerful personal discipline</b></li> <li><b>The 10 time-management techniques</b> worth using (only 10!), and</li> <li><b>Fire yourself</b>! Replace yourself. Make more money from less time, and have more freedom to do big things!</li> </ul>"; 
